  state = {messagesExpress: []}

  componentDidMount(){
    fetch('./a2React-Ninja/routes/users')
      .then(res => res.json())
      .then(users => this.setState({ messagesExpress }));
  }

  render(){
    return (

      <BrowserRouter>
        <div className="App">
          <Navbar />
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/messages/:message_id" component={ClickedMessage} />

        </div>
      </BrowserRouter>

    );
  }
}


export default App;
